postcontent:
Price is firm.

This is arguably the best AR-15 (weight, precision) setup money can buy.  It’ll do well under the 1 moa promised by the manufacturer.

On it’s usage: No running and gunning, no rapid firing.  Field cleaned it after every use and I broke in the barrel like a bench rest shooter.  There is some minor discoloration on the case ejector (just the normal marks brass leaves).  The rails show the markings of affixing the scope and bipod adapter, twice each.  

Rifle: Christensen Arms CA-15.
	-$3,150 msrp  
        -Chambered in 5.56;
        -Black action;
        -Under 300 rounds fired;
        -6.2 pounds, see Christensen website for full details.
Glass: Trijicon ACOG 4x32 BAC Rifle Combat Optic (RCO) Scope
	-$1,727 msrp;
        -Original box included;
        -Red Chevron Reticle;
        -Thumbscrew Mount;
        -TA31RCO-M150CP;
        -see Trijicon website for full details.
Mags:
	-1x Surefire MAG5-60 (60 round), $159 msrp;
	-3x Magpul PMag 30-M (30 round), $14 msrp each;
	-2x Bushmaster 5 Round Mag, maybe $10 each;
Bipods:
	-1x short one;
	-1x long one.
Case: Pelican 1750 Long Case with Foam
	-$366.95 msrp;
	-Foam custom cut by for aforementioned items.
Ammo: 150 rounds, assorted brands.
